function BookShow({ key, book, onDelete }) {

    const handleClick = () => {
        onDelete(book.id);
    };

    return <div className="book-show" key={key}> {book.title}</div>;
    <div className="actions">
        <button className="delete" onClick={handleClick}>Delete
        </button>
    </div>
}

export default BookShow;
